import React, { useState } from 'react';
import '../Register.css';

function FacultyRegister() {
    const [facultyData, setFacultyData] = useState({
        name: '',
        email: '',
        password: '',
        branch: '',
        handlingYears: '',
        subjectCodes: ['']
    });

    const handleChange = (e) => {
        const { name, value } = e.target;
        setFacultyData({ ...facultyData, [name]: value });
    };

    const handleSubmit = (e) => {
        e.preventDefault();
        console.log("Faculty Data:", facultyData);
        // Add logic to send data to the server
    };

    return (
        <div className="register-container">
            <div className="register-card">
                <h2>Faculty Registration</h2>
                <form onSubmit={handleSubmit}>
                    <input
                        type="text"
                        placeholder="Faculty Name"
                        name="name"
                        value={facultyData.name}
                        onChange={handleChange}
                        className="register-input"
                        required
                    />
                    <input
                        type="email"
                        placeholder="Email"
                        name="email"
                        value={facultyData.email}
                        onChange={handleChange}
                        className="register-input"
                        required
                    />
                    <input
                        type="password"
                        placeholder="Password"
                        name="password"
                        value={facultyData.password}
                        onChange={handleChange}
                        className="register-input"
                        required
                    />
                    <input
                        type="text"
                        placeholder="Branch"
                        name="branch"
                        value={facultyData.branch}
                        onChange={handleChange}
                        className="register-input"
                    />
                    <input
                        type="text"
                        placeholder="Handling Years"
                        name="handlingYears"
                        value={facultyData.handlingYears}
                        onChange={handleChange}
                        className="register-input"
                    />
                    <input
                        type="text"
                        placeholder="Subject Codes"
                        name="subjectCodes"
                        value={facultyData.subjectCodes.join(', ')}
                        onChange={handleChange}
                        className="register-input"
                    />
                    <button type="submit" className="register-btn">Register Faculty</button>
                </form>
            </div>
        </div>
    );
}

export default FacultyRegister;
